import React, { Component } from 'react';
 
import ResponsiveMenu from 'react-responsive-navbar';
 
class NavMenu extends Component {
  render() {
    return (
            <nav class="navbar navbar-default navbar-fixed-top">
            <div class="container">
                ...
            </div>
            </nav>
    );
  }
}

export default NavMenu;
